    public static int lengthOfLongestSubstring(String s) {
        if (s.length() == 0) return 0;
//        String longest = "" + s.charAt(0);
        int maxLen = 0;
        int index = s.length();
        while (index > 0) {
            for (int i = 0; i <= s.length() - index; i++) {
                String temp = s.substring(i, i + index);
                if (isRepeating(temp)) {
//                    longest = temp;
//                    maxLen = longest.length();
                    return temp.length();
                }
            }
            index--;
        }
        return maxLen;
    }

    private static boolean isRepeating(String substring) {
        Set<Character> charSet = new HashSet<>();
        for (int i = 0; i < substring.toCharArray().length; i++) {
            if (!charSet.add(substring.charAt(i))) return false;
        }
        return true;
    }
